import React from "react";
import ReactDOM from "react-dom";
import "./index.css";
import App from "./App";

setTimeout(() => {
  ReactDOM.render(
    <React.StrictMode>
      <App />
    </React.StrictMode>,
    document.getElementById("root")
  );
}, 60000);
